sys_variable_value.value:
(function execute(inputs, outputs) {
    var feedUtils = new FeedbackUtils();
    var results = feedUtils.fetchFeedbackDetailsById(inputs.feedback_id);
    if(results){
        outputs.rating = results.f_rating;
        outputs.comments = results.f_comments;
        outputs.event = results.f_event_id;
        outputs.attendee = results.f_att_id;
    }
})(inputs, outputs);

